const doughnutChartData = {
    labels: ["Rent", "Salaries", "Utilities", "Marketing", "Miscellaneous"],
    datasets: [
      {
        label: "Expense Breakdown",
        backgroundColor: ["#f39c12", "#e74c3c", "#9b59b6", "#2ecc71", "#3498db"],
        data: [20000, 35000, 10000, 15000, 5000],
      },
    ],
  };

  export default doughnutChartData;
